const GetImagePath = (index) => {
    var images = [
        '../../images/cat.png',
        '../../images/Penguin.jpg',
        '../../images/cat.png',
        '../../images/Penguin.jpg',
        '../../images/cat.png'];
    return images[index];
}
export default GetImagePath;
